import React from "react";
import "./login.css";

const Login = () => {
  return <div className="login">
      <div className="login-logo">
          <img src="https://c8.alamy.com/comp/2B25X4C/login-icon-in-flat-style-people-secure-access-vector-illustration-on-white-isolated-background-password-approved-business-concept-2B25X4C.jpg" 
          alt=""/>
      </div>
  </div>;
};

export default Login;
